import React, { Component } from 'react'

 class Navbar extends Component {
  render() {
    const bolum='Bilgisayar Mühendisliği';
    const universite= 'Harran Universitesi';
    return (
        <nav className="navbar navbar-expand-lg navbar-dark" style={{backgroundColor:'#121E2D'}}>
        <div className="container-fluid">
          <a className="navbar-brand" href="#">{universite} {bolum} Staj Sistemi</a>
          <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
            <span className="navbar-toggler-icon"></span>
          </button>
          <div className="collapse navbar-collapse" id="navbarSupportedContent">
            <ul className="navbar-nav me-auto mb-2 mb-lg-0">
              <li className="nav-item">
                <a className="nav-link active" aria-current="page" href="#" onClick={(e)=>{e.handleChangePage('Anasayfa')}}>Anasayfa</a>
              </li>
              <li className="nav-item">
                <a className="nav-link" href="#">Link</a>
              </li>
              
             
            </ul>
            
          </div>
        </div>
      </nav>
    )
  }
}
export default Navbar;
